		&lt;div id=&quot;mw-content-text&quot; class=&quot;mw-body-content mw-content-ltr&quot; lang=&quot;pt&quot; dir=&quot;ltr&quot;&gt;&lt;div class=&quot;mw-parser-output&quot;&gt;&lt;p&gt;Esta &lt;b&gt;lista de munic\xc3\xadpios do Esp\xc3\xadrito Santo por popula\xc3\xa7\xc3\xa3o&lt;/b&gt; est\xc3\xa1 baseada na estimativa de 2020 do &lt;a href=&quot;/wiki/Instituto_Brasileiro_de_Geografia_e_Estat%C3%ADstica&quot; title=&quot;Instituto Brasileiro de Geografia e Estat\xc3\xadstica&quot;&gt;IBGE&lt;/a&gt;.&lt;sup id=&quot;cite_ref-IBGE_POP_1-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;#cite_note-IBGE_POP-1&quot;&gt;&lt;span&gt;[&lt;/span&gt;1&lt;span&gt;]&lt;/span&gt;&lt;/a&gt;&lt;/sup&gt; O &lt;a href=&quot;/wiki/Esp%C3%ADrito_Santo_(estado)&quot; title=&quot;Esp\xc3\xadrito Santo (estado)&quot;&gt;Esp\xc3\xadrito Santo&lt;/a&gt; \xc3\xa9 uma das 27 &lt;a href=&quot;/wiki/Unidades_federativas_do_Brasil&quot; title=&quot;Unidades federativas do Brasil&quot;&gt;unidades federativas do Brasil&lt;/a&gt; e \xc3\xa9 dividida em &lt;a href=&quot;/wiki/Lista_de_munic%C3%ADpios_do_Esp%C3%ADrito_Santo&quot; title=&quot;Lista de munic\xc3\xadpios do Esp\xc3\xadrito Santo&quot;&gt;78 munic\xc3\xadpios&lt;/a&gt;. O territ\xc3\xb3rio capixaba equivale a 0,54% do brasileiro e com mais de 4,06 milh\xc3\xb5es habitantes (2,22% da popula\xc3\xa7\xc3\xa3o brasileira),&lt;sup id=&quot;cite_ref-IBGE_POP_1-1&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;#cite_note-IBGE_POP-1&quot;&gt;&lt;span&gt;[&lt;/span&gt;1&lt;span&gt;]&lt;/span&gt;&lt;/a&gt;&lt;/sup&gt; o estado possui a &lt;a href=&quot;/wiki/Lista_de_estados_do_Brasil_por_%C3%A1rea&quot; class=&quot;mw-redirect&quot; title=&quot;Lista de estados do Brasil por \xc3\xa1rea&quot;&gt;vig\xc3\xa9sima terceira maior \xc3\xa1rea territorial&lt;/a&gt; e o &lt;a href=&quot;/wiki/Lista_de_estados_do_Brasil_por_popula%C3%A7%C3%A3o&quot; class=&quot;mw-redirect&quot; title=&quot;Lista de estados do Brasil por popula\xc3\xa7\xc3\xa3o&quot;&gt;d\xc3\xa9cimo quinto contingente populacional dentre os estados do Brasil&lt;/a&gt;.
&lt;/p&gt;&lt;p&gt;A cidade mais populosa do Esp\xc3\xadrito Santo \xc3\xa9 a &lt;a href=&quot;/wiki/Serra_(Esp%C3%ADrito_Santo)&quot; title=&quot;Serra (Esp\xc3\xadrito Santo)&quot;&gt;Serra&lt;/a&gt;, com mais de 527 mil habitantes, sendo a capital estadual, &lt;a href=&quot;/wiki/Vit%C3%B3ria_(Esp%C3%ADrito_Santo)&quot; title=&quot;Vit\xc3\xb3ria (Esp\xc3\xadrito Santo)&quot;&gt;Vit\xc3\xb3ria&lt;/a&gt;, a quarta maior com mais de 365 mil habitantes.&lt;sup id=&quot;cite_ref-IBGE_POP_1-2&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;#cite_note-IBGE_POP-1&quot;&gt;&lt;span&gt;[&lt;/span&gt;1&lt;span&gt;]&lt;/span&gt;&lt;/a&gt;&lt;/sup&gt; Em segunda, vem &lt;a href=&quot;/wiki/Vila_Velha&quot; title=&quot;Vila Velha&quot;&gt;Vila Velha&lt;/a&gt; com aproximadamente 501 mil habitantes.
&lt;/p&gt;
