         &lt;div class=&quot;mw-parser-output&quot;&gt;
          &lt;p&gt;
           Esta
           &lt;b&gt;
            lista de municípios do Espírito Santo por população
           &lt;/b&gt;
           está baseada na estimativa de 2020 do
           &lt;a href=&quot;/wiki/Instituto_Brasileiro_de_Geografia_e_Estat%C3%ADstica&quot; title=&quot;Instituto Brasileiro de Geografia e Estatística&quot;&gt;
            IBGE
           &lt;/a&gt;
           .
           &lt;sup class=&quot;reference&quot; id=&quot;cite_ref-IBGE_POP_1-0&quot;&gt;
            &lt;a href=&quot;#cite_note-IBGE_POP-1&quot;&gt;
             &lt;span&gt;
              [
             &lt;/span&gt;
             1
             &lt;span&gt;
              ]
             &lt;/span&gt;
            &lt;/a&gt;
           &lt;/sup&gt;
           O
           &lt;a href=&quot;/wiki/Esp%C3%ADrito_Santo_(estado)&quot; title=&quot;Espírito Santo (estado)&quot;&gt;
            Espírito Santo
           &lt;/a&gt;
           é uma das 27
           &lt;a href=&quot;/wiki/Unidades_federativas_do_Brasil&quot; title=&quot;Unidades federativas do Brasil&quot;&gt;
            unidades federativas do Brasil
           &lt;/a&gt;
           e é dividida em
           &lt;a href=&quot;/wiki/Lista_de_munic%C3%ADpios_do_Esp%C3%ADrito_Santo&quot; title=&quot;Lista de municípios do Espírito Santo&quot;&gt;
            78 municípios
           &lt;/a&gt;
           . O território capixaba equivale a 0,54% do brasileiro e com mais de 4,06 milhões habitantes (2,22% da população brasileira),
           &lt;sup class=&quot;reference&quot; id=&quot;cite_ref-IBGE_POP_1-1&quot;&gt;
            &lt;a href=&quot;#cite_note-IBGE_POP-1&quot;&gt;
             &lt;span&gt;
              [
             &lt;/span&gt;
             1
             &lt;span&gt;
              ]
             &lt;/span&gt;
            &lt;/a&gt;
           &lt;/sup&gt;
           o estado possui a
           &lt;a class=&quot;mw-redirect&quot; href=&quot;/wiki/Lista_de_estados_do_Brasil_por_%C3%A1rea&quot; title=&quot;Lista de estados do Brasil por área&quot;&gt;
            vigésima terceira maior área territorial
           &lt;/a&gt;
           e o
           &lt;a class=&quot;mw-redirect&quot; href=&quot;/wiki/Lista_de_estados_do_Brasil_por_popula%C3%A7%C3%A3o&quot; title=&quot;Lista de estados do Brasil por população&quot;&gt;
            décimo quinto contingente populacional dentre os estados do Brasil
           &lt;/a&gt;
           .
          &lt;/p&gt;
          &lt;p&gt;
           A cidade mais populosa do Espírito Santo é a
           &lt;a href=&quot;/wiki/Serra_(Esp%C3%ADrito_Santo)&quot; title=&quot;Serra (Espírito Santo)&quot;&gt;
            Serra
           &lt;/a&gt;
           , com mais de 527 mil habitantes, sendo a capital estadual,
           &lt;a href=&quot;/wiki/Vit%C3%B3ria_(Esp%C3%ADrito_Santo)&quot; title=&quot;Vitória (Espírito Santo)&quot;&gt;
            Vitória
           &lt;/a&gt;
           , a quarta maior com mais de 365 mil habitantes.
           &lt;sup class=&quot;reference&quot; id=&quot;cite_ref-IBGE_POP_1-2&quot;&gt;
            &lt;a href=&quot;#cite_note-IBGE_POP-1&quot;&gt;
             &lt;span&gt;
              [
             &lt;/span&gt;
             1
             &lt;span&gt;
              ]
             &lt;/span&gt;
            &lt;/a&gt;
           &lt;/sup&gt;
           Em segunda, vem
           &lt;a href=&quot;/wiki/Vila_Velha&quot; title=&quot;Vila Velha&quot;&gt;
            Vila Velha
           &lt;/a&gt;
           com aproximadamente 501 mil habitantes.
          &lt;/p&gt;
